Os Mundiais eram conquistados pela competência dos times sul-americanos também, muitos times eram grandes esquadrões, de muita qualidade técnica, vale lembrar que, entre 1960 e 2004 conquistamos mais Mundiais e, até 2002, os sul-americanos tinham mais Copas do Mundo que os europeus.

